import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { updateSampleSection } from '../common/sample-base';
import { DocumentEditorComponent, DocumentEditor, ViewChangeEventArgs, Print } from '@syncfusion/ej2-react-documenteditor';
import { TooltipComponent, Position } from '@syncfusion/ej2-react-popups';
import { NumericTextBoxComponent } from '@syncfusion/ej2-react-inputs';
import { DocumentLoader } from './document-loader';
import { TitleBar } from './title-bar';
import { StatusBar } from './status-bar';
import './print.component.css';
DocumentEditorComponent.Inject(Print);
// tslint:disable:max-line-length
function PrintView() {
    React.useEffect(() => {
        updateSampleSection();
        rendereComplete();
    }, [])
    let documenteditor: DocumentEditorComponent;
    let containerPanel: HTMLElement;
    let titleBar: TitleBar;
    let statusBar: StatusBar;
    let documentLoader: DocumentLoader;
    function rendereComplete(): void {
        containerPanel = document.getElementById('documenteditor_container_panel');
        documenteditor.pageOutline = '#E0E0E0';
        documenteditor.resize();
        documenteditor.documentEditorSettings.printDevicePixelRatio = 2;
        documentLoader = new DocumentLoader(documenteditor);
        onLoadDefault();
        documenteditor.viewChange = (e: ViewChangeEventArgs) => {
            onViewChange(e);
        };
        documenteditor.documentChange = (): void => {
            applyPageCountAndDocumentTitle();
        };
        titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), documenteditor, false);
        statusBar = new StatusBar(document.getElementById('documenteditor_statusbar'), documenteditor);
        applyPageCountAndDocumentTitle();
        document.getElementById('uploadfileButton').addEventListener('change', onFileChange);

        document.getElementById('uploadfileButton').setAttribute('accept', '.doc,.docx,.rtf,.txt,.sfdt');
        documenteditor.zoomFactorChange = (): void => {
            statusBar.updateZoomContent();
        };
    }
    return (<div className='control-pane'>
        <div className="col-lg-8 control-section">
            <input type="file" id="uploadfileButton" style={{ position: 'fixed', left: '-100em' }} />
            <div id="panel">
                <div id='documenteditor_titlebar' className="e-de-ctn-title">
                </div>
                <div id="documenteditor_container_panel" style={{ position: 'relative' }}>
                    <DocumentEditorComponent id="container" ref={(scope) => { documenteditor = scope; }} height={'590px'} enablePrint={true} />
                </div>
                <div id="documenteditor_statusbar">
                </div>
                <div className="overlay" id="popup-overlay" style={{ display: 'block;' }}></div>
                <div id="waiting-popup">
                    <svg className="circular" height="40" width="40">
                        <circle className="circle-path" cx="25" cy="25" r="20" fill="none" stroke-width="6" stroke-miterlimit="10" />
                    </svg>
                </div>
            </div>
        </div>
        <div className="col-lg-4 property-section">
            <div style={{ 'paddingTop': '20px' }}>
                <b >Document Editor settings</b>
            </div>
            <table style={{ 'marginTop': '10px', 'marginBottom': '30px' }}>
                <tr>
                    <td style={{ 'width': '50%' }}>
                        <span style={{ 'paddingRight': '10px' }}>Device pixel ratio:</span>
                    </td>
                    <td style={{ 'width': '50%' }}>
                        <TooltipComponent target='#printNumeric' content='Specifies the device pixel ratio for the image generated while printing the document.'>
                            <NumericTextBoxComponent id='printNumeric' width='120px' value={2} min={1} max={10} step={0.5} format='n'
                                decimals={1} change={onPixelRatioChange.bind(this)} >
                            </NumericTextBoxComponent>
                        </TooltipComponent>
                    </td>
                </tr>
            </table>
        </div>
        <div id="action-description">
            <p>This sample demonstrates how to view and print Word documents online using document editor.</p>
        </div>
        <div id="description">
            <p>In this example, document editor is defined as lightweight by injecting only the modules that are necessary for opening
                and printing Word documents.
            </p>
            <p style={{ display: 'block' }}> Document editor provides the following document viewing features:
            </p>
            <ul>
                <li>Open Word documents with document elements like text, images, hyperlinks, tables, bookmarks, page numbers, tables of contents, headers, and footers.</li>
                <li>Scroll or navigate to specific pages.</li>
                <li>Print Word documents in required quality by using your own device pixel ratio.</li>
            </ul>
            <p style={{ display: 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/print/">documentation section.</a>

            </p>
        </div>
    </div>
    );
    function onPixelRatioChange(args: any): void {
        documenteditor.documentEditorSettings.printDevicePixelRatio = args.value;
    }
    function onFileChange(args: any): void {
        if (args.target.files[0]) {
            let path: any = args.target.files[0];
            if (path.name.substr(path.name.lastIndexOf('.')) === '.sfdt') {
                let fileReader: FileReader = new FileReader();
                fileReader.onload = (e: any) => {
                    let contents: any = e.target.result;
                    documenteditor.open(contents);
                };
                fileReader.readAsText(path);
                documenteditor.documentName = path.name.substr(0, path.name.lastIndexOf('.'));
            } else {
                documentLoader.loadFile(path);
            }
        }
        event.preventDefault();
    }
    function onLoadDefault(): void {
        // tslint:disable
        let defaultDocument: Object = {"sfdt":""};
        // tslint: enable               
        let waitingPopUp: HTMLElement = document.getElementById('waiting-popup');
        let overlay: HTMLElement = document.getElementById('popup-overlay');
        documentLoader.loadDefault(defaultDocument);
        documenteditor.documentName = 'Print';
        waitingPopUp.style.display = 'none';
        overlay.style.display = 'none';
    }
    function updateContainerSize(): void {
        let titleBarDiv: HTMLElement = document.getElementById('documenteditor_titlebar');
        let statusBarDiv: HTMLElement = document.getElementById('documenteditor_statusbar');
        if (containerPanel && titleBarDiv && statusBarDiv) {
            var height = (window.innerHeight -
                (titleBarDiv.offsetHeight + statusBarDiv.offsetHeight)) + 'px';
            containerPanel.style.height = height;
            documenteditor.height = height;
        }
    }
    function applyPageCountAndDocumentTitle(): void {
        //Sets Document name.
        titleBar.updateDocumentTitle();
        statusBar.updatePageCount();
    }
    function onViewChange(args: ViewChangeEventArgs): void {
        statusBar.updatePageNumberOnViewChange(args);
    }
}
export default PrintView;